var App = window.App || {};
App = new function() {


	this.config = {
		pageDir: '/page/',
        noAuth: ['login','news','store'],
        aniShow: 'pop-in',
        debug:true,
//      server: 'http://yunzhu.svn.biantikeji.com',
        server: 'http://test-api.cnccgt.com',
        shareLink:'http://test-h5.cnccgt.com/h5/share.base/app',
 		titleNView:{//导航默认
			backgroundColor: '#24a84c', //导航栏背景色
			titleText: '', //导航栏标题
			type:'default', //透明渐变样式
			titleColor: '#fff', //文字颜色
			autoBackButton: true, //自动绘制返回箭头
		},
        
    };
        
       
	mui.plusReady(function() {
	    plus.webview.currentWebview().setStyle({scrollIndicator: 'none'});
	    mui.init({
	        swipeBack: false,
	    });
	    
	    mui('body').on('tap', '[to]', function(e) {

			var data ={};
	        data.url = this.getAttribute('to');
	        data.title = this.getAttribute('title');
	       	data.type = this.getAttribute('type');
	       	data.back = this.getAttribute('back');
	        data.param = this.getAttribute('param');
	        data.ani = this.getAttribute('ani');
	        
//	        var isLogin=!(App.getItem('auth')) ? false : true;
//	        var urlArray = url.split("/");
//			if ($.inArray(urlArray[0], config.noAuth) == -1 && !isLogin) {
//				App.log('权限错误');
//				url = 'login/login';
//				config.aniShow='slide-in-bottom';
//			}else{
//				this.user=App.getItem('auth');
//			}

	        App.open(data);
	       
	 
	   });
	
	});
	
	/**
	 * 打开窗口
	 **/
	this.open = function(data) {
		if (data.param) {
	        data.param = eval('(' + data.param + ')');
	    }else{
	    	data.param = {};
	    }
		
		if (!data.ani) {
	        data.ani = App.config.aniShow;
	    }
		//如果无动画则认定为一级页面，关闭之前创建
//		if (ani == 'none') {
//			var allPage = plus.webview.all();
//			for (var i = 0; i < allPage.length; i++) {
//				if (allPage[i].id !== plus.webview.getLaunchWebview().id) {
//					plus.webview.close(allPage[i]);
//				}
//			}
//		}	
		var id = data.url =='index' ? '/index.html' : App.config.pageDir + data.url + '.html';
		
			data.styles = {
//				top: newpage - top - position, //新页面顶部位置
//		        bottom: newage - bottom - position, //新页面底部位置
		        titleNView:App.config.titleNView,
			};
        
			if(data.title){
				if(data.title == 'none'){
					delete data.styles.titleNView;
				}else{
					data.styles.titleNView = App.config.titleNView;
					data.styles.titleNView.titleText = data.title;
				}
			}
			if(data.type){
				data.styles.titleNView.type = data.type;
			}
			
		mui.openWindow({
		    url: id,
		    id: data.url,
		    styles:data.styles,
		    extras: data.param,
		    createNew: false, //是否重复创建同样id的webview，默认为false:不重复创建，直接显示
		    show: {
		        autoShow: true, //页面loaded事件发生后自动显示，默认为true
		        aniShow: data.ani,   //页面显示动画，默认为”slide-in-right“；
		        //duration: 200 //页面动画持续时间，Android平台默认100毫秒，iOS平台默认200毫秒；
		    },
		    waiting: {
		        autoShow: false, //自动显示等待框，默认为true
		    }
		})

	};
	
	
	/**
     * 获取数据
     **/
    this.getItem = function (key) {
        var jsonStr = window.localStorage.getItem(key.toString());
        return jsonStr ? JSON.parse(jsonStr).data : null;
    };
    /**
     * 保存数据
     */
    this.setItem = function (key, val) {
        var value = JSON.stringify({
            data: val
        });
        return window.localStorage.setItem(key.toString(), value);
    };
    /**
     * 删除数据
     */
    this.delItem = function (key) {
        return window.localStorage.removeItem(key);
    }
    
    /**
	 * 参数接收
	 */
	this.request = function(action, callback) {
		window.addEventListener(action, function(event) {
			var info = event.detail ? event.detail : {
				data: null
			};
			callback(info.data);
		});
	};
	
	/**
	 * 参数传递
	 */
	this.send = function(winId, action, data) {
		mui.fire(plus.webview.getWebviewById(winId), action, {
			data: data
		});
	}
	
	/**
	 * 打印数据
	 */
	this.log = function(data) {
	if(!this.config.debug){
		return false;
	}
    	data = JSON.stringify(data);
//      console.log(data);
    }
	
	/**
	 * HTTP访问
	 */
	this.http = function(url, data, success,type) {
		
			App.log(App.config.server + '/' + url)
			App.log(data)
		    data.token = App.getItem('token');
		    var type = type || 'post'
			mui.ajax(App.config.server + '/' + url, {
				dataType: 'json',
				type: type,
				crossDomain: true,
				async: true,
				timeout: 10000,
				data: data,
				headers:{
					"AUTH-TOKEN":data.token
				},
				success: function(info) {
					App.log(info);
					//需要登录
					if(info.status==-1){
						App.delItem('token');
						var page={"url":"user/login/login","title":"none","ani":"none"};
						mui.plusReady(function() {
							App.open(page);
						});
						return false;
					}
					
					if (typeof(success) == "function") {
						success(info);
					}
				},
				error: function(xhr, type, errorThrown) {
					App.log("error");
					App.log(errorThrown);
					App.log(type);
					mui.toast('服务器繁忙,请稍后再试!');
				}
			});
	};

	/**
	 * 上传文件
	 */
	this.upload = function(dir, files, data, success, error) {
		App.log(App.config.server + '/' + dir)
		App.log(data)
		mui.plusReady(function() {
			var task = plus.uploader.createUpload(App.config.server+ '/'+dir, {
				method: "POST",
				blocksize: -1,
				priority: 100
			}, function(t, status,b) {
				plus.nativeUI.closeWaiting();
				if(status!=200){
					mui.toast('上传失败');
					return;
				}
				App.log('upload_end');
				var result = JSON.parse(t.responseText);
				App.log(result);
				if (result.status != 1) {
					mui.toast(result.msg);
					return;
				}
		
				if (typeof(success) == "function") {
					success(result);
				}
				
			});
			task.setRequestHeader('AUTH-TOKEN',App.getItem('token'));
			task.addData("token",App.getItem('token'));
			
			
			mui.each(data, function(k, value) {
				task.addData(k, value);
			});
			mui.each(files, function(k, path) {
				task.addFile(path, {
					key: k
				});
			});
	

			task.addEventListener("statechanged", function(t, status) {
				switch (t.state) {
					case 1:
						// 开始
						plus.nativeUI.showWaiting();
						//tools.debug('开始上传');
						break;
					case 2:
						// 已连接到服务器
						//tools.debug('已连接到服务器');
						break;
					case 3:
						//上传进度
						var a = t.uploadedSize / t.totalSize * 100;
						//tools.debug("已上传" + parseInt(a) + "%");
						break;
					case 4:
						//上传结束
						//tools.debug(t);
						plus.nativeUI.closeWaiting();
						break;

					
				}

			});
			task.start();
		});
	};
	/**
	 * 上传照片 
	 */
	this.images = function(dir, success, error) {
		mui.plusReady(function() {
			plus.nativeUI.actionSheet({
				cancel: "取消",
				buttons: [{
					title: "拍照"
				}, {
					title: "从相册选取"
				}]
			}, function(e) {
			
				if (e.index == 1) {
					   
		                var cmr = plus.camera.getCamera();
						var res = '400*800';
						var fmt = 'jpg';
						cmr.captureImage(function(path,e) {
								App.upload(dir, {
									'file': path
								}, {dirpath:{images:path}}, success, error);
							},
							function(error) {}, {
								resolution: res,
								format: fmt
							}
						);
                		
					
				}
				if (e.index == 2) {
					
	                    
						plus.gallery.pick(function(path) {
							App.upload(dir, {
								'file': path
							}, {dirpath:{images:path}}, success, error);
						}, function(e) {}, {
							filter: "image"
						});
					
				}
			});
		});
	};

	
	/**
	 * 打开远程地址
	 */
	this.openRurl=function(_url){
		/**
		 * 打开的时候带上用户的 token
		 */
		 var t=Math.random();
		if(_url.indexOf('?')>-1){
			_url=_url+'&token='+App.getItem('token')+'&_r='+t;
		}else{
			_url=_url+'?token='+App.getItem('token')+'&_r='+t;
		}
		
		
//		plus.nativeUI.showWaiting();
		var ws = plus.webview.open(_url, '__out_html', {
					additionalHttpHeaders:{
						"AUTH-TOKEN":App.getItem('token'),
						"APP-VERSION":plus.runtime.version
					},
					titleNView:{//导航默认
						backgroundColor: '#24a84c', //导航栏背景色
						titleText: '', //导航栏标题
						type:'default', //透明渐变样式
						titleColor: '#fff', //文字颜色
						autoBackButton: true, //自动绘制返回箭头
						progress:{color:'#ffffff'},
					},
					
				}, 'slide-in-right',200,function(e,b){
//					mui.back=function(){
//						ws.close();
//					}
//					plus.nativeUI.closeWaiting();
				});
	}
	
	/**
	 * 打开远程地址
	 */
	this.openRDialogUrl=function(_url){
		/**
		 * 打开的时候带上用户的 token
		 */
		 var t=Math.random();
		if(_url.indexOf('?')>-1){
			_url=_url+'&token='+App.getItem('token')+'&_r='+t;
		}else{
			_url=_url+'?token='+App.getItem('token')+'&_r='+t;
		}

		var ws = plus.webview.open(_url, '__out_dialog_html', {
					additionalHttpHeaders:{
						"AUTH-TOKEN":App.getItem('token'),
						"APP-VERSION":plus.runtime.version
					},
					bottom:'80px',
					left:"10%",
					top:"20%",
					height:'70%',
					width:"80%",
					right:"10%",
					background:"transparent"
					
				}, 'fade-in');
	}
	
	/**
	 * 打开pushdialog 显示
	 */
	this.openPushDialog=function(content){
		setTimeout(function(){
				var pushDialog = plus.webview.create('./page/push-notice-dialog.html', 'push-notice-dialog.html', {
					bottom:'80px',
					left:"5%",
					height:'120px',
					width:"90%",
					background:"transparent"
				},{content:content});
				plus.webview.show(pushDialog,'slide-in-bottom');
				setTimeout(function(){
					pushDialog.close();
				},3000)
			},2000)
	}
	/**
	 * 检测网络状态
	 */
	this.checkNetwork=function(){
		var nt = plus.networkinfo.getCurrentType();
		switch(nt) {
			case plus.networkinfo.CONNECTION_ETHERNET:
			case plus.networkinfo.CONNECTION_WIFI:
			case plus.networkinfo.CONNECTION_CELL2G:
			case plus.networkinfo.CONNECTION_CELL3G:
			case plus.networkinfo.CONNECTION_CELL4G:
				return true;
				break;
			default:
				return false;
				break;
		}
	}
	/**
	 * 网络状态提示
	 */
	this.networkStatus=function(){
		var nt = plus.networkinfo.getCurrentType();
				switch(nt) {
					case plus.networkinfo.CONNECTION_ETHERNET:
					case plus.networkinfo.CONNECTION_WIFI:
						App.openPushDialog("网络已连接");
						break;
					case plus.networkinfo.CONNECTION_CELL2G:
					case plus.networkinfo.CONNECTION_CELL3G:
					case plus.networkinfo.CONNECTION_CELL4G:
						//alert("Switch to Cellular networks!");
						break;
					default:
//						mui.alert("网络已断开");
						App.openPushDialog("网络已断开");
						break;
				}
	}
	
};

/**
 * 上报设备信息
 */
function upDevice() {
	var info = plus.push.getClientInfo();
	if(info.clientid == '') {
		setTimeout(function() {
			upDevice();
		}, 2000)
		return;
	}
	App.log(info);
	App.http('v1/user.base/bindDevice', {
		device: info.clientid,
		system: plus.os,
		app_version:plus.runtime.version,
		device_info: plus.device
	}, function(data, status) {
		App.log(data);
	});
}